import React from "react"
import {Card, Button, CardColumns} from 'react-bootstrap'

export default function PostList(props) {
    const {posts} = props

    return(
        <div style={{paddingTop: 20}}>
            <CardColumns>
                {posts && posts.map(post => <p>{post.body}</p>)}
            </CardColumns>
        </div>
    )
}
